window.bookSummaryJSON = "Bobby Pendragon is a seemingly normal 14-year-old boy. He has a family, a home, and even Marley, his beloved dog. But there is something very special about Bobby: he is going to save the world. <p>And not just Earth as we know it. Bobby is slowly starting to realize that life in the cosmos isn't quite what he thought it was. And before he can object, he is swept off to an alternate dimension known as Denduron, a territory inhabited by strange beings, ruled by a magical tyrant, and plagued by dangerous revolution.</p> <p>If Bobby wants to see his family again, he's going to have to accept his role as savior and accept it wholeheartedly. Because, as he is about to discover, Denduron is only the beginning.</p>"; 
